import React, { Component } from "react";
import {
  InputGroup,
  InputGroupAddon,
  InputGroupText,
  Input
} from "react-bootstrap";
import { Form, Button, Col, Card } from "react-bootstrap";

class RetriveRecords extends Component {
  render() {
    return (
      <div className="form">
        <Card style={{ width: "48rem" }}>
          <Card.Body>
            <Card.Title>Search Patient Records</Card.Title>
            <form
              noValidate
              //validated={validated}
              //onSubmit={e => this.handleSubmit(e)}
            >
              <Form.Row>
                <Form.Group as={Col}>
                  <Form.Label>Admission Date</Form.Label>
                  <Form.Control
                    required
                    type="date"
                    placeholder="Date of Admission"
                    //value={this.state.admissionDate}
                    name="admissionDate"
                    //onChange={this.handleChange}
                  />
                </Form.Group>
                <Form.Group as={Col}>
                  <Form.Label>Discharge Date</Form.Label>
                  <Form.Control
                    required
                    type="date"
                    placeholder="Discharge Date"
                    //value={this.state.dischageDate}
                    name="dischageDate"
                    onChange={this.handleChange}
                  />
                </Form.Group>
              </Form.Row>
              <Button variant="primary" type="submit">
                Submit
              </Button>
            </form>
            <div>
              <input
                style={{ width: "45rem" }}
                placeholder="Search for..."
                // value={this.state.query}
                // onChange={this.handleInputChange}
              />
            </div>
          </Card.Body>
        </Card>
      </div>
    );
  }
}
export default RetriveRecords;
